import React, { Component } from 'react';
import Header from './Header';
import Meta from '../components/Meta';

class Page extends Component {
    render() {
        return (
            <div>
            <Meta />
            <Header />
            {this.props.children}   
            </div>
        );
    }
}

export default Page;
